import React from 'react';
import {
  Card,
  CardContent,
  Container,
  Grid,
  Typography
} from '@material-ui/core';
import { gql, useQuery } from '@apollo/client';

/*
  GraphQL
*/
const GET_SUBMISSIONS = gql`
  query getAllSubmissions{
    submissions{
      _id
      score
      strength
      weakness
    }
  }
`;

/*
  Component
*/
function calculateNPS(data){
  data.submissions.map((submission) => {
    console.log(submission.score);
  })
}

export default function Admin(){
  const {loading, data} = useQuery(GET_SUBMISSIONS);

  if (loading) return 'Loading...';

  calculateNPS(data);

  return(
    <div style={{'flexGrow': 1}}>
    <Grid container spacing={3}>
    <Grid item xs={12}>
      <Card>
        <Typography>NPS Score:</Typography>
      </Card>
    </Grid>
    {
      data.submissions.map(submission => (
        <Grid item xs={6} sm={4} key={submission._id}>
          <Card variant="outlined">
            <CardContent>
              <Typography>Score: {submission.score}</Typography>
              <Typography>Strength: {submission.strength}</Typography>
              <Typography>Weakness: {submission.weakness}</Typography>
            </CardContent>
          </Card>
        </Grid>
      ))
    }
    </Grid>
    </div>
  );
};
